(()=>{var o=Array.from(document.querySelectorAll("li.menu__links")),c=e=>{if(console.log(e),e.id==="hamburger"){let t=e.getAttribute("data-state");!t||t==="closed"?(e.setAttribute("data-state","opened"),e.setAttribute("aria-expanded","true"),o.forEach(s=>{s.classList.add("menu__links_tucked"),console.log(s)})):(e.setAttribute("data-state","closed"),e.setAttribute("aria-expanded","false"),o.forEach(s=>{s.classList.remove("menu__links_tucked")}))}if(e.classList.contains("menu__links"))switch(e.id){case"linkToDogs":console.log("hit");break;case" linkToAction":break;case"linkToHelp":break;case"  linkToContact":break}};console.log("good");document.addEventListener("click",e=>{c(e.target)});})();
